  SizedBox _buildCard(PlaceModel model, BuildContext context) {
    return SizedBox(
      width: MediaQuery.of(context).size.width * 0.9,
      height: 150,
      child: Card(
        shape: RoundedRectangleBorder(borderRadius: BorderRadius.circular(8)),
        color: Colors.grey.shade100,
        child: Row(children: [
          Image.memory(
            base64.decode(model.image),
            width: MediaQuery.of(context).size.width * 0.5,
          ),
          Expanded(
            child: Column(
              mainAxisAlignment: MainAxisAlignment.center,
              children: [
                Text(model.name),
                const SizedBox(
                  height: 5,
                ),
                SingleChildScrollView(
                  child: Text(
                    model.desc,
                  ),
                ),
                const SizedBox(
                  height: 5,
                ),
                Text(model.location), // model.location
              ],
            ),
          )
        ]),
      ),
    );
  }

  Widget _buildShimmer(BuildContext context) {
    return Container(
      margin: EdgeInsets.all(4),
      width: MediaQuery.of(context).size.width,
      height: 100,
      decoration: BoxDecoration(borderRadius: BorderRadius.circular(12),color: Colors.grey.shade600,),
      child: Row(
        crossAxisAlignment: CrossAxisAlignment.center,
        mainAxisAlignment: MainAxisAlignment.center,
        children: [
          Shimmer.fromColors(
              baseColor: Colors.grey,
              highlightColor: Colors.grey.shade300,
              child: Container(
                height: 80,
                width: 80,
                color: Colors.grey,
              )),
          Column(
            crossAxisAlignment: CrossAxisAlignment.start,
            mainAxisAlignment: MainAxisAlignment.start,
            children: [
              Shimmer.fromColors(
                  baseColor: Colors.grey,
